import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import { Component } from 'react'
import NavBar from './components/NavBar'
import { RefreshSharp } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '60ch',
      bottom: -30
      //background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    },
  },
}));

const useStyles1 = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: '60ch',
      bottom: 39,
      left: 700
      //background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    },
  },
}));

const useStylesbutton = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      left: 565,
      bottom: 100,
      width: '12ch',
    },
  },
}));

const classes = useStyles();
const classes1 = useStyles1();
const classes2 = useStylesbutton();
const [value, setValue] = React.useState('Controlled');
const handleChange = (event) => {
  setValue(event.target.value);
};

ReactDOM.render(

  <React.StrictMode>
  <div>
      <div>
        <NavBar />
      </div>
      <form className={classes.root} noValidate autoComplete="off">
      <TextField
      id="filled-textarea"
      label="Input Code"
      placeholder="ZOT Code"
      multiline
      variant="filled"
      inputRef="inputcode"
      />
    </form>

    <form className={classes1.root} noValidate autoComplete="off">
    <TextField
    id="filled-textarea"
    label="Output Code"
    //placeholder="Placeholder 1"
    multiline
    variant="filled"
    inputRef="outputcode"
    />
    </form>

    <div className={classes2.root}>
    <Button onClick={this.sendApiReaquest()} variant="contained">Run</Button>
    </div>
  </div>
  </React.StrictMode>,
  document.getElementById('root')

);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
